public class LeylineFeedKelbalor : SuramarQuests.LeylineQuest
{
	public LeylineFeedKelbalor()
	{
		Name = "Leyline Feed: Kel'balor";
		QuestId.Clear();
		QuestId.Add(43588);
	}
	public override bool IsComplete()
	{
		return Questing.ObjectiveComplete(this, 1) && base.IsComplete();
	}
	public override bool Pulse()
	{
		var p = new Vector3(2025.856, 3388.209, 163.039, "None");
		GoToTask.ToPositionAndIntecractWithGameObject(p, 253071);
		return base.Pulse();
	}

}

